def count_lines(file_path):
    line_count = 0
    with open(file_path, 'r') as file:
        for line in file:
            line_count += 1
    return line_count

def calculate_risk_level(line_count):
    # 根据行数确定风险水平
    if line_count <= 100:
        return 'Low'
    elif line_count <= 500:
        return 'Medium'
    else:
        return 'High'

