    def opendirectory(self):
        folderDialog = QFileDialog.getExistingDirectory(self, '打开文件夹')
        self.lines = 0
        if folderDialog:
            # 获取选中的文件夹路径
            self.folderPath = folderDialog
            print(self.folderPath)
            # 进行函数检测
            directory_tree1 = directory_tree(folderDialog)
            # 提取自定义函数和库函数
            functions = process_c_files(directory_tree1, folderDialog)
            # print("函数信息:")
            for function in functions:
                # print(function)
                try:
                    item = QTreeWidgetItem()
                    item.setText(0, function['function_name'] + ';' + function['parameter'])
                    item.setText(1, function['return_type'])
                    #item.setText(1, function['path'])
                    self.treeWidget_3.addTopLevelItem(item)
                except Exception as e:
                    print("发生异常:", str(e))

            self.thread1 = Thread(target=self.generate_tree)
            self.thread1.start()

    def generate_tree(self):
        model = QFileSystemModel()
        model.setRootPath(self.folderPath)
        model.setNameFilters(['*.c'])
        self.treeView_2.setModel(model)

        # 设置 QTreeView 的根索引为项目根目录
        root_index = model.setRootPath(self.folderPath)
        self.treeView_2.setRootIndex(root_index)
        parent_path = model.filePath(root_index)
        for name in os.listdir(parent_path):
            path = os.path.join(parent_path, name)
            index = model.index(path)
            if os.path.isdir(path):
                self.file_system_model = model
                self.populate_directory_tree(index)
            else:
                self.tableWidget_2.setRowCount(self.lines+1)
                self.tableWidget_2.setItem(self.lines,0,QTableWidgetItem(name))
                self.tableWidget_2.setItem(self.lines,1,QTableWidgetItem(str(count_lines(path))))
                self.tableWidget_2.setItem(self.lines,2,QTableWidgetItem(calculate_risk_level(count_lines(path))))
                self.lines = self.lines + 1

    def populate_directory_tree(self, parent_index):
            parent_path = self.file_system_model.filePath(parent_index)
            for name in os.listdir(parent_path):
                    path = os.path.join(parent_path, name)
                    index = self.file_system_model.index(path)
                    if os.path.isdir(path):
                            self.populate_directory_tree(index)
                    else:
                        self.tableWidget_2.setRowCount(self.lines + 1)
                        self.tableWidget_2.setItem(self.lines, 0, QTableWidgetItem(name))
                        self.tableWidget_2.setItem(self.lines, 1, QTableWidgetItem(str(count_lines(path))))
                        self.tableWidget_2.setItem(self.lines, 2,   QTableWidgetItem(calculate_risk_level(count_lines(path))))
                        self.lines = self.lines+1

    def on_tree_item_clicked(self, index: QModelIndex):
        if not index.isValid():
                return

        if index.column() != 0:
                return

        file_path = self.treeView_2.model().filePath(index)
        print(file_path)
        if not file_path:
                return

        try:
                with open(file_path, 'r') as file:
                        file_content = file.read()
                        self.textEdit_3.setPlainText(file_content)
                mysql = SQL()
                ss = mysql.select_scan_function(mysql.cursor)
                for function in ss:
                    # print(function)
                    if(function['path']==file_path):
                        try:
                            item = QTreeWidgetItem()
                            item.setText(0, function['function_name'] + ';' + function['parameter'])
                            item.setText(1, function['return_type'])
                            # item.setText(1, function['path'])
                            self.treeWidget_3.addTopLevelItem(item)
                        except Exception as e:
                            print("发生异常:", str(e))
                mysql.close_SQL(mysql.cursor, mysql.cnx)
        except IOError as e:
                print('无法打开文件:', e)

